import React, {useRef} from 'react'

function App() {
  const file = useRef(null)
  return (
    <div>
      <form method="post" action="/run" encType="multipart/form-data">
        <input
          type="file"
          name="file"
          ref={file}
        />
        <button type="submit" disabled={!file.current}>Submit</button>
      </form>
    </div>
  );
}

export default App;
